import React from "react";
import Dashboardnav from "../global/Dashboardnav";
import { useAuthUser } from "react-auth-kit";
import Dashboardheader from "../sections/Dashboardheader";

function Dashboardaffiliateinfluencerhub() {

    const auth = useAuthUser()

    return (
        <div className='dashboard-landing-page-container'>
            <Dashboardnav link="Profile" Type={auth().user_type}/>
            <div className="dasboad-landing-page-section-container">
            <Dashboardheader title="Influencer Hub"/>
            <Affiliateprofile user={auth().email} />
            </div>
        </div>
    );
}

export default Dashboardaffiliateinfluencerhub
